import React from 'react';
import Slider from './slider';
import Content from './Content';
import OurTeam from './OurTeam';
import OurWebsite from './OurWebsite';

function AllHome() {
  return (
    <div>
      <Slider/>
      <Content/>
      <OurTeam/>
      <OurWebsite/>
    </div>
  );
}

export default AllHome;
